import React, { Component } from 'react';
import './SignIn.scss';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { styled } from '@mui/system';


// $accent-color: linear-gradient(90deg,#ed145b 0,#7b31f4);
const MyComponent = styled(TextField)({
  width: '100%',
              marginBottom: '25px',
              '& .MuiFilledInput-underline': {
                '&:hover:before': {
                  borderBottom: '3px solid red'
                }
              }      
})

const SignIn = () => {

    const styles = '3px solid red';
    return (
      <div className='sign-in'>
        <h1 className='sign-in-title'>Sign in</h1>
        <form className="signin-form" noValidate autoComplete='off'>
        
          <div className='signin-form-password-area'> 
            <MyComponent   
            
            id="filled-basic" 
            label="password" 
            variant="filled"
            required
            />
          </div>
          <div className='signin-form-button'>
            <Button
              sx={{
                marginTop: '50px',
                borderRadius: '0px',
                backgroundColor: '#e00bcb'
              }}
              variant="contained" 
              size="large"
            >
              Large
            </Button>    
          </div>
            
        </form>
      </div>
    )
  
}

export default SignIn;
